import './App.css';
import backgroundapp from './background-fon1.jpg';


function App() {
  return (
    <div className="App">
       <img className = "backgroundapp" src = {backgroundapp}/>
      <header className="App-header">
        <header className = "App-header-left"></header>
        <header className = "App-header-right"></header>

      </header>
    </div>
  );
}

export default App;
